import React, { Component } from "react";

const Like = (props) => {
  const getLikeUnlike = (props) => {
    let classes = "fa fa-heart-o";
    classes = props.count % 2 === 0 ? "fa fa-heart-o" : "fa fa-heart";
    return classes;
  };
  return (
    <i
      onClick={props.onLike}
      className={this.getLikeUnlike()}
      aria-hidden='true'
    ></i>
  );
};

export default Like;
